    false,nt"url": null,nt"notes": "Lidar data was acquired over a 1613 square
    mile area of interest over Atlantic, Ocean, and Monmouth Counties, New Jersey. The
    lidar data had a nominal point spacing no greater than 1m with a side lap that did
    not exceed 60%. The lidar data was flown, under went boresight calibration, was
    processed and then converted to the final deliverable datum and projection provided
    as NAD83/2007 New Jersey State Plane Coordinate System in US Survey Feet. The vertical
    datum was North American Vertical Datum 1988 (NAVD88).",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
